import React from 'react';

const Calibration = () => {
    return (
       <main>
          <div className="jumbotron">
            <h1 className="ml-4">I confirm my volume is 50%</h1>
            <button type="button" className="btn btn-success">Finished</button>
          </div>
       </main>
    );
}

export default Calibration;
